const ListCountries = ({ countriesToShow, selectCountry }) => {

    return (
        <div>
            <ul>    
            {countriesToShow.map(
                country => {
                    return ( 
                        <form onSubmit={selectCountry}> 
                            {country.name} 
                            <button type="submit" value={country.id} >show</button>
                        </form>
                    )
                }
            )}
            </ul>
        </div>
    )
}

export default ListCountries
